FastSimulationNTUPToHist::FastSimulationNTUPToHist(TTree *tree)
{
// if parameter tree is not specified (or zero), connect the file
// used to generate this class and read the Tree.
   if (tree == 0) {
      TFile *f = (TFile*)gROOT->GetListOfFiles()->FindObject("T1_McAtNlo.af2.NTUP.root");
      if (!f) {
         f = new TFile("T1_McAtNlo.af2.NTUP.root");
      }
      tree = (TTree*)gDirectory->Get("physics");

   }
   Init(tree);
}

FastSimulationNTUPToHist::~FastSimulationNTUPToHist()
{
   if (!fChain) return;
   delete fChain->GetCurrentFile();
}

Int_t FastSimulationNTUPToHist::GetEntry(Long64_t entry)
{
// Read contents of entry.
   if (!fChain) return 0;
   return fChain->GetEntry(entry);
}
Long64_t FastSimulationNTUPToHist::LoadTree(Long64_t entry)
{
// Set the environment to read one entry
   if (!fChain) return -5;
   Long64_t centry = fChain->LoadTree(entry);
   if (centry < 0) return centry;
   if (!fChain->InheritsFrom(TChain::Class()))  return centry;
   TChain *chain = (TChain*)fChain;
   if (chain->GetTreeNumber() != fCurrent) {
      fCurrent = chain->GetTreeNumber();
      Notify();
   }
   return centry;
}

